import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import { Typography, TextField, Dialog, DialogActions, DialogContent, DialogContentText } from '@mui/material';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

function Addstudents() {
    const [dialogOpen, setDialogOpen] = useState(false);
    const [dialogMessage, setDialogMessage] = useState('');
    const [studentID, setStudentID] = useState('');  // รหัสนักศึกษา
    const [studentName, setStudentName] = useState('');  // ชื่อนักศึกษา
    const [studentEmail, setStudentEmail] = useState(''); // อีเมลนักศึกษา
    const [studentPhone, setStudentPhone] = useState(''); // เบอร์โทรนักศึกษา
    const [studentYear, setStudentYear] = useState('');   // ปีที่สมัคร

    const checkDuplicateStudent = async (studentID, studentName) => {
        try {
            const response = await fetch(`http://localhost:9999/students`);
            const students = await response.json();

            // Check if the student ID or name already exists
            const isDuplicate = students.some(
                (student) => student.S_id === studentID || student.S_name === studentName
            );

            return isDuplicate;
        } catch (error) {
            console.error('Error fetching student data:', error);
            return false;  // If there's an error fetching data, assume no duplicate
        }
    };

    const handleConfirm = async () => {
        const studentData = {
            S_id: studentID,
            S_name: studentName,
            S_email: studentEmail,
            S_phone: studentPhone,
            S_project: '',
            S_CSB01: '',
            S_CSB02: '',
            S_CSB03: '',
            S_year: studentYear,
            S_match: '',
            S_T_SP1: '',
            S_T_SP2: ''
        };

        try {
            // Check for duplicates before adding the student
            const isDuplicate = await checkDuplicateStudent(studentID, studentName);

            if (isDuplicate) {
                setDialogMessage('รหัสนักศึกษา หรือ ชื่อนักศึกษา ซ้ำในระบบ');
                setDialogOpen(true);
                return;
            }

            const response = await fetch('http://localhost:9999/students', {
                method: 'POST',  // Use POST to add a new student
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(studentData),
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            // If successful, set the success message
            setDialogMessage('บันทึกรายชื่อนักศึกษาสำเร็จ');
            setDialogOpen(true);
        } catch (error) {
            console.error('There was a problem with the fetch operation:', error);
            setDialogMessage('เกิดข้อผิดพลาดในการบันทึกรายชื่อนักศึกษา');
            setDialogOpen(true);
        }
    };

    const handleCloseDialog = () => {
        setDialogOpen(false);
    };

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Box sx={{ marginLeft: 40 }}>
                                <Typography>
                                    <h1>เพิ่มรายชื่อนักศึกษา</h1>
                                </Typography>

                                {/* ฟิลด์สำหรับรหัสนักศึกษา */}
                                <Box sx={{ marginTop: 2 }}>
                                    <TextField
                                        label="รหัสนักศึกษา"
                                        value={studentID}
                                        onChange={(e) => setStudentID(e.target.value)}
                                        fullWidth
                                    />
                                </Box>

                                {/* ฟิลด์สำหรับชื่อนักศึกษา */}
                                <Box sx={{ marginTop: 2 }}>
                                    <TextField
                                        label="ชื่อนักศึกษา"
                                        value={studentName}
                                        onChange={(e) => setStudentName(e.target.value)}
                                        fullWidth
                                    />
                                </Box>

                                {/* ฟิลด์สำหรับอีเมลนักศึกษา */}
                                <Box sx={{ marginTop: 2 }}>
                                    <TextField
                                        label="อีเมลนักศึกษา"
                                        value={studentEmail}
                                        onChange={(e) => setStudentEmail(e.target.value)}
                                        fullWidth
                                    />
                                </Box>

                                {/* ฟิลด์สำหรับเบอร์โทรนักศึกษา */}
                                <Box sx={{ marginTop: 2 }}>
                                    <TextField
                                        label="เบอร์โทรนักศึกษา"
                                        value={studentPhone}
                                        onChange={(e) => setStudentPhone(e.target.value)}
                                        fullWidth
                                    />
                                </Box>

                                <Box>
                                    <Button sx={{ marginTop: 5, marginLeft: 30, marginRight: 10 }} variant="contained" onClick={handleConfirm}>
                                        Confirm
                                    </Button>
                                </Box>

                                {/* Dialog to show success or error message */}
                                <Dialog
                                    open={dialogOpen}
                                    onClose={handleCloseDialog}
                                    aria-labelledby="alert-dialog-title"
                                    aria-describedby="alert-dialog-description"
                                >
                                    <DialogContent>
                                        <DialogContentText id="alert-dialog-description">
                                            {dialogMessage}
                                        </DialogContentText>
                                    </DialogContent>
                                    <DialogActions>
                                        <Button onClick={handleCloseDialog} color="primary">
                                            Close
                                        </Button>
                                    </DialogActions>
                                </Dialog>
                            </Box>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
}

export default Addstudents;
